package com.example.rxlistview.model;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;import java.util.ArrayList;import java.util.List;@SuppressWarnings("unused")public class BlogWrapper {    @SerializedName("dataa")    private List<Blog> mData;    @SerializedName("code")    @Expose    private String code;    @SerializedName("message")    @Expose    private String message;    @SerializedName("error")    private Boolean mError;    @SerializedName("data")    @Expose    private ArrayList<BlogWrapper> dataList;    @SerializedName("message")    private String mMessage;    @SerializedName("status")    private String mStatus;    @SerializedName("image")    private String image;    @SerializedName("success")    @Expose    private boolean success;    public List<Blog> getBlog() {        return mData;    }    public void setBlog(List<Blog> data) {        mData = data;    }    public Boolean getError() {        return mError;    }    public void setError(Boolean error) {        mError = error;    }    public String getMessage() {        return mMessage;    }    public void setMessage(String message) {        mMessage = message;    }    public String getStatus() {        return mStatus;    }    public void setStatus(String status) {        mStatus = status;    }    public List<Blog> getmData() {        return mData;    }    public void setmData(List<Blog> mData) {        this.mData = mData;    }    public Boolean getmError() {        return mError;    }    public void setmError(Boolean mError) {        this.mError = mError;    }    public String getmMessage() {        return mMessage;    }    public void setmMessage(String mMessage) {        this.mMessage = mMessage;    }    public String getmStatus() {        return mStatus;    }    public void setmStatus(String mStatus) {        this.mStatus = mStatus;    }    public String getImage() {        return image;    }    public void setImage(String image) {        this.image = image;    }    public boolean isSuccess() {        return success;    }    public void setSuccess(boolean success) {        this.success = success;    }    public ArrayList<BlogWrapper> getDataList() {        return dataList;    }    public void setDataList(ArrayList<BlogWrapper> dataList) {        this.dataList = dataList;    }    public String getCode() {        return code;    }    public void setCode(String code) {        this.code = code;    }}